(function(Scratch) {
	if (!Scratch.extensions.unsandboxed) {
		throw new Error("Hey!\nYou need to run this extension in unsandboxed mode!");
	}
	
    class Extension {
        getInfo() {
            return {
                "blockIconURI": "data:image/png;base64,",
                "id": "lgmworldonlineutils",
                "name": "LGM World Online Utilities",
                "color1": "#0088ff",
                "color2": "#0063ba"
            }
        }
    }

    Scratch.extensions.register(new Extension());
})(Scratch);
